import React from 'react';

const TreeNode = ({ node }) => (
  <ul>
    <li>
      {node.name}
      {node.children && node.children.length > 0 && (
        <ul>
          {node.children.map(childNode => (
            <TreeNode key={childNode.id} node={childNode} />
          ))}
        </ul>
      )}
    </li>
  </ul>
);


const SomeComponent = () => {
  const treeData = [
    {
      id: 1,
      name: 'Root 1',
      children: [
        {
          id: 2,
          name: 'Child 1',
        },
        {
          id: 3,
          name: 'Child 2',
          children: [
            {
              id: 4,
              name: 'Grandchild',
            },
          ],
        },
      ],
    },
    {
      id: 5,
      name: 'Root 2',
    },
  ];

  return (
    <div>
      <h1>Here is a tree:</h1>
      <Tree data={treeData} />
    </div>
  );
};

export default SomeComponent;
